    false,nt"url": null,nt"notes": "This narrative report for Moosehorn NWR
    (including the Edmunds Unit) outlines Refuge accomplishments from May through August
    of 1955. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, mammals, raptors, and fish- is also
    covered. The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing, haying, and timber removal. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, and
    fishing. Items of interest, N-R forms, and photographs are attached.",nt"license_title":
